// import ExpenseItem from "./components/ExpenseItem";
import Expenses from "./components/Expenses";

function App() {
  const dataVal = [
    { id: "i1", title: "Ipad", amount: 850, date: new Date(2023, 0, 1) },
    { id: "i2", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
    { id: "i3", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
    { id: "i4", title: "Ipad", amount: 850, date: new Date(2022, 11, 10) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses dataVal={dataVal} index={0} />
    </div>
  );
}

export default App;
